import React from 'react';
import './menu.css'
import dishes from '../../dishes'

const Menu = () => {
    return (
        <div>
            {
                dishes.map((dish)=>(
                    <div>
                        {dish.name}
                    </div>
                ))
            }
        </div>
    );
};

export default Menu;
